    public int bruteForce(String s) {
        int maxCount = 0;
        int lastOutIdx = 0;


        for (int i = 0; i < s.length(); i++) {

            if (lastOutIdx != s.length())
                i = lastOutIdx;
            log.info("## ls: {}", lastOutIdx);
            //log.info("why?");
            boolean contains = false;
            int currentCount = 0;
            String currentStr = "";


            for (int j = 1; !contains
                    && i + j <= s.length()
                    && s.substring(i).length() > maxCount;
                 j++) {
                //log.info("{}, {}, {}", i, j, i + j);
                currentStr = s.substring(i, i + j);
                int idx = i + j - 1;
                //log.info("## currentStr : {}, currentCount : {}, cont : {}, idx : {}, i : {}, j : {}", currentStr, currentCount, contains, idx, i, j);
                if (currentStr.length() > 1 && idx < s.length()) {
                    char currentCha = s.charAt(idx);
                    contains = containsCharacter(currentStr.substring(0, currentStr.length() - 1), currentCha);
                    //log.info("## currentStr : {},currentCha : {} , cont : {}", currentStr, currentCha, contains);
                }
                if (!contains) {
                    currentCount++;
                    lastOutIdx = i + j - 1;
                }


            }
            maxCount = Math.max(maxCount, currentCount);
        }
        return maxCount;
    }


